import { Routes,Route } from "react-router-dom";
import { ToastContainer } from 'material-react-toastify';
import 'material-react-toastify/dist/ReactToastify.css';
import { Loginpage, ForgotPage, SignupPage  } from "../../pages/authentication";
import { LandingPage, Cart, Wishlist, ProductWithFilter,ErrorPage } from "../../pages";
import { PrivateRoute } from "../private-routes/private-route";
export const  PublicRoute=()=>{
    return (
        <>
        <Routes>
        <Route path="/login" element={<Loginpage />} />
        <Route path="/signup" element={<SignupPage />} />
        <Route path="/forgot-password" element={<ForgotPage />} />
        <Route path="/" element={<LandingPage />} />
        <Route path="/products" element={<ProductWithFilter />} />
        <Route path="*"element={<ErrorPage/>}/>
        <Route 
        path="/wishlist" 
        element={
            <PrivateRoute>
                <Wishlist />
            </PrivateRoute>
        } />
        <Route 
        path="/cart" 
        element={
            <PrivateRoute>
                <Cart />
            </PrivateRoute>
        } />
      </Routes>
      <Route
      path="/profile"
      element={
          <PrivateRoute></PrivateRoute>
      }
      />
      <ToastContainer
        position="top-right"
        autoClose={3000}
        hideProgressBar={false}
        newestOnTop
        closeOnClick
        rtl={false}
        pauseOnFocusLoss
        draggable
        pauseOnHover
      />
     </>
    )
}
